### INSERTION PREMIERE TABLE ###
#drop table bornes;
#drop table stations;
#drop table connecteurs;
#drop table operateurs;
#drop table fabricants;

CREATE DATABASE IF NOT EXISTS BORNES_RECHARGE_AUTOLIB;
USE BORNES_RECHARGE_AUTOLIB;

CREATE TABLE IF NOT EXISTS `Bornes` 
(
    `ID_Point` varchar(50),
    `Latitude` decimal(9,7) NOT NULL,
    `Longitude` decimal(9,7) NOT NULL,
    `Type_emplacement` char(8),
    `Accessibilite` char(9),
    `RefStation` char(15) NOT NULL,
    `Nb_places` tinyint(1),
    `RefOp` char(4),
    `RefConnecteur` char(5),
    `RefFabricant` char(2),
    PRIMARY KEY (`ID_Point`)
);


### INSERTION DEUXIEME TABLE ###

CREATE TABLE IF NOT EXISTS `Stations` 
(
    `ID_Station` char(15),
    `ID_Autolib` char(8),
    `Nom_Station` varchar(50) NOT NULL,
    `Nom_Voie` varchar(50) NOT NULL,
    `CP` int(5),
    PRIMARY KEY (`ID_Station`)
);

	
### INSERTION TROISIEME TABLE ###

CREATE TABLE IF NOT EXISTS `Connecteurs` 
(
    `ID_Connecteur` char(5),
    `Type_connecteur` varchar(100),
    `Puissance_PDC` decimal(3,1) NOT NULL,
    `Nombre_PDC` tinyint(1) NOT NULL,
    `Type_courant_PDC` varchar(30),
    `Comptage_énergie` char(3),
    `Type_de_recharge` char(10),
    PRIMARY KEY(`ID_Connecteur`)
);

	
### INSERTION QUATRIEME TABLE ###

CREATE TABLE IF NOT EXISTS `Operateurs` 
(
    `ID_Operateur` char(4),
    `Operateur` varchar(20) UNIQUE,
    `Nom_reseau` varchar(25) NOT NULL,
    `Type_communication_supervision` char(5),
    `Type_systeme_identification` varchar(15),
    `Acces_reseau` varchar(15),
    `Tarif_general` varchar(150) NOT NULL,
    `Tarif_autopartage` varchar(10) ,
    `Mode_paiement` varchar(50) NOT NULL,
    PRIMARY KEY(`ID_Operateur`)
);


### INSERTION CINQUIEME TABLE ###

CREATE TABLE IF NOT EXISTS `Fabricants` 
(
    `ID_Fabricant` char(2),
    `Fabricant_borne` varchar(20) NOT NULL UNIQUE,
    `Referentiel_produit` varchar(50),
    `Tel_SAV` char(14) UNIQUE,
    `Horaires_SAV` varchar(20),
    PRIMARY KEY (`ID_Fabricant`)
);

	
### AJOUT DES FOREIGN KEY ###

ALTER TABLE Bornes ADD FOREIGN KEY (RefStation) REFERENCES Stations(ID_Station);
ALTER TABLE Bornes ADD FOREIGN KEY (RefOP) REFERENCES Operateurs(ID_Operateur);
ALTER TABLE Bornes ADD FOREIGN KEY (RefConnecteur) REFERENCES Connecteurs(ID_Connecteur);
ALTER TABLE Bornes ADD FOREIGN KEY (RefFabricant) REFERENCES Fabricants(ID_Fabricant);
